import React from 'react';
import { Link } from 'react-router-dom';

function ExplicaciónDomiciliario() {
    return (
    <div>
        <h1>¿Cómo funciona?</h1>
        <div>
            <h2>Te haremos 5 preguntas</h2>
            <p>Loren ipśum loren</p>
            <h2>Opcional: SI tienes y usas twitter, nos encantaría verlo</h2>
            <p>Escribe tu usuario de twitter:</p>
            <h2>Confirma tu registro con tu correo electrónico</h2>
            <p>Una vez te registres, te enviaremos un correo electrónico para confirmar tu registro</p>
            <h2>Regístrate  </h2>
            <h2>Listo?</h2>
            <Link to='/badges/new' className='btn btn-primary'>
                            New Badge
            </Link>

        </div>
    </div>
    )
}

export default ExplicaciónDomiciliario;
